import  Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";
import squadPic from "../images/squadPic.jpg";
import reportImg from "../images/report.svg";
import pinImg from "../images/pin.svg";
import squadImg from '../images/squad.svg';

function Home() {
    return(
        <div className="App">
            <Container id="squadPicContainer">
                <img id="squadPic" alt="Squad" src={squadPic}></img>
            </Container>
            <Container className="d-flex mt-2" id="cardContainer">

                <Card className="card">
                    <Card.Img className="cardImg" variant="top" src={pinImg} />
                    <Card.Body>
                        <Card.Text>
                            Find Us
                        </Card.Text>
                    </Card.Body>
                </Card>
                <Card className="card">
                    <Card.Img className="cardImg" variant="top" src={squadImg} />
                    <Card.Body>
                        <Card.Text>
                            Squad
                        </Card.Text>
                    </Card.Body>
                </Card>
            </Container>
        </div>       
    )
}

export default Home;
